import React from "react";
import CollectionItem from "../../components/collection-item/collection-item.component";

import "./category.styles.scss";

const CategoryPage = ({
  match: {
    params: { categoryId }
  }
}) => (
  <div className="category">
    <h2>CATEGORY PAGE</h2>
  </div>
);

export default CategoryPage;
